# **Способ 2**. Подключение к базе данных SQL

# +
# создадим соединение с базой данных chinook
conn = sql.connect("chinook.db")

# выберем все строки из таблицы tracks
sql_data = pd.read_sql("SELECT * FROM tracks;", conn)  # vs. read_sql_query

# посмотрим на результат
sql_data.head(3)

# +
# Скачиваем ZIP и извлекаем DB в память
chinook_zip_url = os.environ.get("CHINOOK_ZIP_URL", "")
with zipfile.ZipFile(io.BytesIO(requests.get(chinook_zip_url).content)) as z_var:
    db_content = z_var.read([f for f in z_var.namelist() if f.endswith(".db")][0])

# создадим соединение с базой данных chinook
with tempfile.NamedTemporaryFile() as tmp:
    tmp.write(db_content)
    tmp.flush()
    with sql.connect(tmp.name) as file_conn:
        with sql.connect(":memory:") as conn:
            file_conn.backup(conn)

            # выберем все строки из таблицы tracks
            sql_data = pd.read_sql("SELECT * FROM tracks;", conn)

# посмотрим на результат
sql_data.head(3)
